import React, { FC, useEffect } from "react";
import styled from "styled-components";
import { TopBar } from "../TopBar/TopBar";
import { LeftMenu } from "../LeftMenu/LeftMenu";
import{useDispatch} from 'react-redux'
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import {getUsers} from "../../actions/actionTypes/userActions";
type GetUsers = ReturnType<typeof getUsers>
const Wrapper = styled.div``;

const Content = styled.div`
  max-width: 1300px;
  align-items: center;
  display: flex;
`;

const MainPage: FC = () => {
  const dispath = useDispatch();
  useEffect(()=>{
    dispath<GetUsers>(getUsers());
  },[])
  return (
    <Router>
      <Wrapper>
        <TopBar />
        <Content>
          <LeftMenu />
          <Switch>
            <Route path="/YourNetwork">YourNetwork</Route>
            <Route path="/YourPublications">YourPublications</Route>
            <Route path="/publications">publications</Route>
            <Route path="/ecosystem">ecosystem</Route>
            <Route path="/entities">entities</Route>
          </Switch>
        </Content>
      </Wrapper>
    </Router>
  );
};
export default MainPage;
